import React from "react";
import ModelOne from "./ModelOne";

function ModelControl() {
  const ifpp = false;
  return (
    <>
      {ifpp ? (
        <ModelOne Title="Sign in to your account" />
      ) : (
        <ModelOne Title="Sign up an account!" />
      )}
    </>
  );
}

export default ModelControl;
